"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[426],{74578:(e,t,r)=>{r.r(t),r.d(t,{default:()=>s,johnChapter20PL:()=>n});const n={chapter:20,title:"Jean 20",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"A pierwszego dnia po sabacie Maryja Magdalena przysz\u0142a rano, gdy jeszcze by\u0142o ciemno, do grobu, i ujrza\u0142a kamie\u0144 odj\u0119ty od grobu.",strong:[{text:"premier",strong:"G4413",start:3,end:10},{text:"jour",strong:"H3117",start:11,end:15},{text:"comme",strong:"G2531",start:84,end:89}]},{number:2,text:"Bie\u017ca\u0142a tedy, i przysz\u0142a do Szymona Piotra, i do onego drugiego ucznia, kt\xf3rego mi\u0142owa\u0142 Jezus, i rzek\u0142a im: Wzi\u0119li Pana z grobu, a nie wiemy, gdzie go po\u0142o\u017cyli.",strong:[{text:"disciple",strong:"G3101",start:46,end:54},{text:"Seigneur",strong:"G2962",start:116,end:124}]},{number:3,text:"Tedy wyszed\u0142 Piotr i on drugi ucze\u0144, i szli do grobu.",strong:[{text:"disciple",strong:"G3101",start:18,end:26}]},{number:4,text:"I bie\u017celi obaj spo\u0142em; ale on drugi ucze\u0144 bie\u017ca\u0142 pr\u0119dziej, ni\u017c Piotr, i przyszed\u0142 pierwszy do grobu.",strong:[{text:"deux",strong:"G1417",start:19,end:23},{text:"disciple",strong:"G3101",start:47,end:55},{text:"premier",strong:"G4413",start:98,end:105}]},{number:5,text:"A nachyliwszy si\u0119, ujrza\u0142 le\u017c\u0105ce p\u0142\xf3tna; wszak\u017ce nie wszed\u0142.",strong:[{text:"terre",strong:"H776",start:48,end:53}]},{number:6,text:"Tedy przyszed\u0142 Szymon Piotr, id\u0105c za nim, i wszed\u0142 do grobu, i ujrza\u0142 le\u017c\u0105ce p\u0142\xf3tna,",strong:[{text:"dans",strong:"H6887",start:46,end:50},{text:"terre",strong:"H776",start:96,end:101}]},{number:7,text:"A chust\u0119, kt\xf3ra by\u0142a na g\u0142owie jego, nie z p\u0142\xf3tny le\u017c\u0105c\u0105, ale osobno zwini\u0119t\u0105 na jednem miejscu.",strong:[{text:"avec",strong:"G1848",start:58,end:62},{text:"dans",strong:"H6887",start:85,end:89}]},{number:8,text:"Tedy wszed\u0142 i on drugi ucze\u0144, kt\xf3ry by\u0142 przyszed\u0142 pierwszy do grobu, i ujrza\u0142, i uwierzy\u0142.",strong:[{text:"disciple",strong:"G3101",start:14,end:22},{text:"premier",strong:"G4413",start:44,end:51}]},{number:9,text:"(Bo jeszcze nie wiedzieli Pisma, \u017ce mia\u0142 z martwych zmartwychwsta\u0107.)",strong:[{text:"selon",strong:"G2531",start:40,end:45}]},{number:10,text:"I wr\xf3cili si\u0119 zasi\u0119 do domu uczniowie.",strong:[]},{number:11,text:"Lecz Maryja sta\u0142a u grobu, zewn\u0105trz p\u0142acz\u0105c; a gdy p\u0142aka\u0142a, nachyli\u0142a si\u0119 do grobu.",strong:[{text:"Comme",strong:"G2531",start:64,end:69},{text:"regarder",strong:"G3708",start:105,end:113},{text:"dans",strong:"H6887",start:114,end:118}]},{number:12,text:"I ujrza\u0142a dw\xf3ch Anio\u0142\xf3w w bia\u0142ych szatach siedz\u0105cych, jednego u g\u0142owy, a drugiego u n\xf3g, gdzie by\u0142o po\u0142o\u017cone cia\u0142o Jezusowe.",strong:[{text:"deux",strong:"G1417",start:12,end:16},{text:"blanc",strong:"G3022",start:32,end:37},{text:"corps",strong:"G4561",start:79,end:84}]},{number:13,text:"I rzekli jej oni: Niewiasto! czemu p\u0142aczesz? Rzek\u0142a im: \u017be wzi\u0119li Pana mego, a nie wiem, gdzie go po\u0142o\u017cyli.",strong:[{text:"Seigneur",strong:"G2962",start:92,end:100}]},{number:14,text:"A to powiedziawszy, obr\xf3ci\u0142a si\u0119 nazad, i ujrza\u0142a Jezusa stoj\u0105cego, a nie wiedzia\u0142a, \u017ce to by\u0142 Jezus.",strong:[]},{number:15,text:"Rzek\u0142 jej Jezus: Niewiasto! czemu p\u0142aczesz? kogo szukasz? Ona mniemaj\u0105c, \u017ce jest ogrodnik, rzek\u0142a mu: Panie! je\u017ali\u015b ty go wyni\xf3s\u0142, powiedz mi, gdzie\u015b go po\u0142o\u017cy\u0142, a ja go wezm\u0119.",strong:[{text:"Seigneur",strong:"G2962",start:109,end:117}]},{number:16,text:"Rzek\u0142 jej Jezus: Maryjo! Ona si\u0119 obr\xf3ciwszy, rzek\u0142a mu: Rabboni! co si\u0119 wyk\u0142ada: Mistrzu!",strong:[{text:"dire",strong:"H559",start:80,end:84}]},{number:17,text:"Rzek\u0142 jej Jezus: Nie dotykaj si\u0119 mnie; bom jeszcze nie wst\u0105pi\u0142 do Ojca mego; ale id\u017a do braci moich, a powiedz im: Wst\u0119puj\u0119 do Ojca mego i Ojca waszego, i do Boga mego i Boga waszego.",strong:[{text:"Dieu",strong:"G2316",start:171,end:175},{text:"Dieu",strong:"G2316",start:185,end:189}]},{number:18,text:"Przysz\u0142a Maryja Magdalena, opowiadaj\u0105c uczniom, \u017ce widzia\u0142a Pana, i \u017ce jej to powiedzia\u0142.",strong:[{text:"Seigneur",strong:"G2962",start:65,end:73}]},{number:19,text:"A gdy by\u0142 wiecz\xf3r onego dnia, pierwszego po sabacie, a drzwi by\u0142y zamknione, gdzie byli uczniowie zgromadzeni, dla boja\u017ani \u017bydowskiej, przyszed\u0142 Jezus, i stan\u0105\u0142 w po\u015brodku, i rzek\u0142 im: Pok\xf3j wam!",strong:[{text:"jour",strong:"H3117",start:14,end:18},{text:"premier",strong:"G4413",start:33,end:40},{text:"paix",strong:"G1515",start:226,end:230},{text:"avec",strong:"G1848",start:236,end:240}]},{number:20,text:"A to powiedziawszy, pokaza\u0142 im r\u0119ce i bok sw\xf3j. I rozweselili si\u0119 uczniowie, ujrzawszy Pana.",strong:[{text:"dans",strong:"H6887",start:85,end:89},{text:"Seigneur",strong:"G2962",start:111,end:119}]},{number:21,text:"Tedy im zasi\u0119 rzek\u0142 Jezus: Pok\xf3j wam! jako mi\u0119 pos\u0142a\u0142 Ojciec, tak i ja was posy\u0142am.",strong:[{text:"nouveau",strong:"G2537",start:18,end:25},{text:"paix",strong:"G1515",start:30,end:34},{text:"avec",strong:"G1848",start:40,end:44},{text:"Comme",strong:"G2531",start:51,end:56}]},{number:22,text:"A to powiedziawszy, tchn\u0105\u0142, i rzek\u0142 im: We\u017amijcie Ducha \u015awi\u0119tego.",strong:[{text:"Esprit",strong:"G4151",start:69,end:75}]},{number:23,text:"Kt\xf3rymby\u015bcie odpu\u015bcili grzechy, odpuszczone\u0107 s\u0105; a kt\xf3rymby\u015bcie zatrzymali, zatrzymane\u0107 s\u0105.",strong:[]},{number:24,text:"A Tomasz, jeden z dwunastu, kt\xf3rego zowi\u0105 Didymus, nie by\u0142 z nimi, gdy przyszed\u0142 Jezus.",strong:[{text:"Thomas",strong:"G2381",start:0,end:6},{text:"avec",strong:"G1848",start:51,end:55}]},{number:25,text:"I m\xf3wili mu drudzy uczniowie: Widzieli\u015bmy Pana. Ale on rzek\u0142 im: Je\u017ali nie ujrz\u0119 na r\u0119kach jego ran gwo\u017adziowych, i nie w\u0142o\u017c\u0119 palca mego w rany gwo\u017adziowe, i nie w\u0142o\u017c\u0119 r\u0119ki mojej w bok jego, nie uwierz\u0119.",strong:[{text:"Seigneur",strong:"G2962",start:55,end:63},{text:"dans",strong:"H6887",start:97,end:101},{text:"dans",strong:"H6887",start:160,end:164},{text:"main",strong:"G5495",start:206,end:210},{text:"dans",strong:"H6887",start:211,end:215}]},{number:26,text:"A po o\u015bmiu dniach zasi\u0119 byli wewn\u0105trz uczniowie jego, i Tomasz z nimi. Przyszed\u0142 Jezus, (gdy drzwi by\u0142y zamknione,) i stan\u0105\u0142 w po\u015brodku, i rzek\u0142: Pok\xf3j wam!",strong:[{text:"nouveau",strong:"G2537",start:52,end:59},{text:"dans",strong:"H6887",start:60,end:64},{text:"maison",strong:"G3609",start:68,end:74},{text:"Thomas",strong:"G2381",start:79,end:85},{text:"avec",strong:"G1848",start:98,end:102},{text:"paix",strong:"G1515",start:186,end:190},{text:"avec",strong:"G1848",start:196,end:200}]},{number:27,text:"Potem rzek\u0142 Tomaszowi: Podaj palec tw\xf3j sam, a obacz r\u0119ce moje, i podaj r\u0119k\u0119 twoj\u0119, a w\u0142\xf3\u017c w bok m\xf3j, a nie b\u0105d\u017a niedowiarkiem, ale wiernym.",strong:[{text:"Thomas",strong:"G2381",start:14,end:20},{text:"main",strong:"G5495",start:82,end:86},{text:"dans",strong:"H6887",start:99,end:103}]},{number:28,text:"I odpowiedzia\u0142 Tomasz, i rzek\u0142 mu: Pan m\xf3j i B\xf3g m\xf3j!",strong:[{text:"Thomas",strong:"G2381",start:0,end:6},{text:"Seigneur",strong:"G2962",start:25,end:33},{text:"Dieu",strong:"G2316",start:41,end:45}]},{number:29,text:"Rzek\u0142 mu Jezus: \u017be\u015b mi\u0119 widzia\u0142, Tomaszu, uwierzy\u0142e\u015b; b\u0142ogos\u0142awieni, kt\xf3rzy nie widzieli, a uwierzyli.",strong:[]},{number:30,text:"I wiele te\u017c innych znak\xf3w czyni\u0142 Jezus przed uczniami swymi, kt\xf3re nie s\u0105 napisane w tych ksi\u0119gach.",strong:[{text:"beaucoup",strong:"G4183",start:51,end:59},{text:"dans",strong:"H6887",start:102,end:106}]},{number:31,text:"Ale te s\u0105 napisane, aby\u015bcie wierzyli, \u017ce Jezus jest Chrystus, Syn Bo\u017cy, a wierz\u0105c, aby\u015bcie \u017cywot mieli w imieniu jego.",strong:[{text:"Christ",strong:"G5547",start:71,end:77},{text:"Fils",strong:"G5207",start:82,end:86},{text:"Dieu",strong:"G2316",start:90,end:94}]}]},s=n}}]);
